The Declaration Day of Christ, Imam Mahdi, Messiah, Buddha, Krishna will happen very very very soon. Please awake your Heart, Ears and Eyes with an open mind. The announcement will be on Television, Radio and the Internet.

These are books talking about the most important event in the history of humankind and the world.

Please share these books with loved ones, family, friends and everybody.

Always use your own discernment and research before believing in anything. Never have blind faith in anything even these books. Always remember only through your own discernment and research will you find the real truth.

Trust your heart and have faith. Always remember to Love and Share because we are all one. Love for All and Sharing is the first step to solving all the problems of humanity. God and the Truth are Within us.

Divine Light will Always Shine on you my Brothers and Sisters. It will Shine on all of Humanity. It will Shine on the whole world and everything within.

Thank you very much
